INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("2015/04/01 15:00:00", 1, "かずまさ", 0, 0, 191301, 191301, 450, 0, "カズマサ", 2.22, 0, 0, 0, 0, 1, 6, 1, 191301, 0, "2030/12/31 15:00:00", "【物理】皆から愛される漁師町のポンコツ漁師。\nユニオンバーストは強力なスタン効果を持つが、\n自身のＨＰが50%以下では尻もちをついてしまう。\n\n・通常攻撃とユニオンバーストを駆使して戦う。", 6, 191301, 850);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("2015/04/01 15:00:00", 0, "こっころ", 0, 0, 191401, 191401, 0, 0, "コッコロ", 0.0, 0, 0, 0, 0, 0, 6, 0, 0, 0, "2030/12/31 15:00:00", "", 6, 0, 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("2015/04/01 15:00:00", 0, "しゅじんこう", 0, 0, 191501, 191501, 150, 0, "主人公", 0.0, 0, 0, 0, 0, 0, 0, 0, 100101, 0, "2030/12/31 15:00:00", "残されたわずかな時間で宿題を終わらせんとする\nルーセント学院の生徒。楽しい夏休みの思い出を\n守るため、山積みの宿題へと立ち向かう。", 0, 100101, 1600);
